import React from "react";
import "../Style/homeStyle.css";

// Header komponenta
const Header = () => {
  return (
    <header>
      <div className="logo">
        {/* Ovdje se može dodati logotip TabTracker aplikacije */}
        Logo
      </div>
      <nav>
        <ul>
          <li>
            <a href="#">Početna</a>
          </li>
          <li>
            <a href="#">Omiljeni tabovi</a>
          </li>
          <li>
            <a href="#">Arhiva tabova</a>
          </li>
          <li>
            <a href="#">Profil</a>
          </li>
          <li>
            <a href="#">Postavke</a>
          </li>
        </ul>
      </nav>
    </header>
  );
};

// Kartica komponenta
const Card = ({ title, artist, album }) => {
  return (
    <div className="card">
      <div className="card-image">
        {/* Ovdje se može dodati ikona ili slika albuma */}
        Slika albuma
      </div>
      <div className="card-content">
        <h2>{title}</h2>
        <p>{artist}</p>
      </div>
    </div>
  );
};

// Preporučeni tabovi komponenta
const RecommendedTabs = () => {
  // Ovdje se mogu dohvatiti preporučeni tabovi iz API-ja ili drugog izvora podataka
  const recommendedTabs = [
    { title: "Pjesma 1", artist: "Izvođač 1", album: "Album 1" },
    { title: "Pjesma 2", artist: "Izvođač 2", album: "Album 2" },
    { title: "Pjesma 3", artist: "Izvođač 3", album: "Album 3" },
  ];

  return (
    <section className="recommended-tabs">
      <h2>Preporučeni tabovi</h2>
      <div className="card-container">
        {recommendedTabs.map((tab, index) => (
          <Card
            key={index}
            title={tab.title}
            artist={tab.artist}
            album={tab.album}
          />
        ))}
      </div>
    </section>
  );
};

// Footer komponenta
const Footer = () => {
  return (
    <footer>
      {/* Dodatne informacije o aplikaciji */}
      <p>© 2023 TabTracker. Sva prava pridržana.</p>
      <p>
        <a href="#">Uvjeti korištenja</a> | <a href="#">Pravila privatnosti</a>{" "}
        | <a href="#">Kontakt</a>
      </p>
    </footer>
  );
};

// Glavna App komponenta
const App = () => {
  return (
    <div className="App">
      <Header />
      <section className="main-content">
        <h1>TabTracker</h1>
        <div className="card-container">
          {/* Ovdje se prikazuju popularni ili najnoviji tabovi */}
          <Card title="Pjesma 1" artist="Izvođač 1" album="Album 1" />
          <Card title="Pjesma 2" artist="Izvođač 2" album="Album 2" />
          <Card title="Pjesma 3" artist="Izvođač 3" album="Album 3" />
        </div>
        <RecommendedTabs />
      </section>
      <Footer />
    </div>
  );
};

export default App;
